export const LOGIN = 'LOGIN'
export const LOGOUT = 'LOGOUT'

export function login(history = '') {
    history.push("/compositions") // steam auth
    
    return {
        type: LOGIN,
        payload: true,
    }
}

export function logout(data = '') {
    return {
        type: LOGOUT,
        payload: false,
    }
}
